	[MaritalStatusCodeSystem] [nvarchar](128) NULL,
	[EthnicGroupCode] [nvarchar](255) NULL,
	[EthnicGroupCodeSystem] [nvarchar](128) NULL,
	[ReligiousAffiliationCode] [nvarchar](255) NULL,
	[ReligiousAffiliationCodeSystem] [nvarchar](128) NULL,
