	[NationalityCode] [nvarchar](255) NULL,
	[NationalityCodeSystem] [nvarchar](128) NULL,
	[VIPCode] [nvarchar](255) NULL,
	[VIPCodeSystem] [nvarchar](128) NULL,
	[PreferredLanguageCode] [nvarchar](255) NULL,
	[PreferredLanguageCodeSystem] [nvarchar](128) NULL,
	[Country] [nvarchar](500) NULL,
	[StateOrProvince] [nvarchar](500) NULL,
